import axios from 'axios';
import authHeader from './auth-header';
const API_URL = 'http://localhost:8080';


class EwasteDataService {
  getAll() {
    return axios.get(API_URL+ "/api/items",{ headers: authHeader() });
  }

  get(id) {
    return axios.get(`/items/${id}`);
  }

  create(data) {
    return axios.post(`/items`, data);
  }

  update(id, data) {
    return axios.put(`/items/${id}`, data);
  }

  delete(id) {
    return axios.delete(`/items/${id}`);
  }

  deleteAll() {
    return axios.delete(`/items`);
  }

  findByTitle(title) {
    return axios.get(`/items?title=${title}`);
  }
}

export default new EwasteDataService();
